css:
@-moz-document url-prefix("https://www.youtube.com/")
{
  body
  {
    background-image: url('https://wallpaperscraft.com/image/mountains_lake_photoshop_reflection_116723_1920x1080.jpg') !important;
    background-repeat: no-repeat !important;
    background-position: right top !important;
    background-attachment: fixed !important;
  }

  #yt-masthead-container
  {
    background: rgba(255, 255, 255, 0.61) !important;
  }

  .guide-pinned .guide-pinning-enabled #appbar-guide-menu
  {
    background: rgba(255, 255, 255, 0.61) !important;
  }

  .webkit .yt-uix-expander-collapsed .yt-ui-ellipsis
  {
    background: transparent;
  }

  li.guide-section h3 a
  {
    color: #154b90;
  }

  .yt-lockup .yt-lockup-meta a, .yt-lockup .yt-lockup-description a, .yt-lockup .yt-lockup-byline a
  {
    color: #064626;
  }

  .exp-responsive .feed .yt-lockup-dismissable .yt-lockup-title .yt-uix-tile-link
  {
    background: transparent;
  }

  a.yt-uix-tile-link.yt-ui-ellipsis.yt-ui-ellipsis-2.yt-uix-sessionlink.spf-link
  {
    color: #051b5d;
  }

  .yt-lockup
  {
    color: #291414;
  }

  .webkit .yt-ui-ellipsis-2
  {
    background: transparent;
  }

  .exp-responsive .feed .yt-lockup-dismissable .yt-lockup-title .yt-uix-tile-link
  {
    color: #051b5d;
  }

  a.yt-uix-tile-link.yt-ui-ellipsis.yt-ui-ellipsis-2.yt-uix-sessionlink.spf-link
  {
    color: rgba(22, 47, 7, 0.81);
  }

  #masthead-appbar
  {
    background-color: rgba(255, 255, 255, 0) !important;
  }

  .guide-item.guide-item-selected, .guide-item.guide-item-selected:hover, .guide-item.guide-item-selected .yt-deemphasized-text, .guide-item.guide-item-selected:hover .yt-deemphasized-text
  {
    background: #154b90;
  }

  #appbar-nav
  {
    background: rgba(255, 255, 255, 0.61) !important;
  }

  .yt-card
  {
    background: rgba(255, 255, 255, 0.61) !important;
  }
}
